const lowValueColorString = 'OrangeRed';
const highValueColorString = 'DarkGreen';
const thresholdValues = [0, 0.25, 0.75, 1.25, 2, 5, 50];

export const getLowValueColorString = () => {
    return lowValueColorString;
}

export const getHighValueColorString = () => {
    return highValueColorString;
}

export const getThresholdValues = () => {
    return thresholdValues;
}

lowValueColorString, highValueColorString, thresholdValues;
